import React, { useState } from 'react';
import './App.css';
import { Route, Link, BrowserRouter as Router, Switch } from 'react-router-dom'
import './Login'
import Login from './Login';
import GuardedRoute from 'react-guarded-route'


const ValidateUserLogged = () => {
  console.log(sessionStorage.getItem('userLoggedIn') !== null)
  // return sessionStorage.getItem('userLoggedIn') !== null;
  return false;
}

function App() {
  return (
    <Router>
      <Route exact path='/'>
        <Home></Home>
      </Route>
      <GuardedRoute exact path="/about" validatorFunction={ValidateUserLogged} redirectTo={Home}>
        <About></About>
      </GuardedRoute>
      <Route path="/login">
        <Login/>
      </Route>
    </Router>
  );
}

function About() {
  return (
    <h1>About</h1>
  )
}

function Home() {
  return (
    <h1>Home</h1>
  )
}

export default App;
